Sinopsis :
Musim Panas di kota kecil Riverdale digoncang prahara ketika Jason Blossom, putra dari pria terkaya di Riverdale, tenggelam dan diduga tewas. Seusai musim panas, Archie Andrews, seorang siswa SMA kembali bersekolah dengan menyimpan suatu rahasia. Pada hari dimana Jason tenggelam, ia mendengar suara tembakan di hutan, yang berarti bahwa Jason sebenarnya dibunuh. Namun Archie tak bisa mengatakan rahasia itu pada siapapun, sebab pada saat itu ia tengah bermesraan dengan gurunya sendiri, Miss Grundy.

Premis cerita ini cukup keren sebenarnya. Para remaja di Riverdale terlibat dalam pemecahan suatu kasus pembunuhan, sementara sang tokoh utama punya rahasia kotor yang membuatnya tak bisa membeberkan bukti penting yang dimilikinya. Tapi semakin episodenya bergulir, justru serial ini lebih menyoroti kehidupan pribadi para siswa Riverdale (terutama kisah cinta segitiga antara Archie, Betty Cooper, dan Veronica Lodge, tiga tokoh utamanya) dan bukan kasus pembunuhannya. Untunglah tiap karakternya cukup “engaging” dan kisah hidup mereka cukup enak dinikmati. 
